    return (
      <div className="edit-profile">
        <div className="edit-avatar">
          <img className="user-avatar" src={avatar} alt="avatar" />
          <ImagePickerContainer getImage={() => {}} />
        </div>
      </div>
    );
  }
}

export default EditProfile;
